INSERT INTO `cms_content` VALUES (1,4,'<h4 class=\"faq-title faq_post\">Q:&nbsp;Can I post my property interest via SMS/Whatsapp? What is the number and any format I have to follow?&nbsp;</h4>\n<p>A: Yes, you can post both buying or selling interest. Kindly add <strong>Ah Gong</strong> <strong>(+6017-8761590)</strong> into your contact list. The following are the formats of posting,&nbsp;</p>\n<p>1)&nbsp;<strong>Buying Interest&nbsp;<strong>(Minimum Requirement)</strong></strong></p>\n<p>&lt;<strong>Buy</strong>&gt; (Verb) + &lt;<strong>Property type</strong>&gt; (Bungalow, semi-d etc.) + &lt;<strong>Area</strong>&gt; (Jalan Anggerik, Taman Johor Jaya) +&nbsp;&lt;<strong>Budget </strong>(RM)&gt; <br />to <strong>+6017-8761590</strong></p>\n<p>via SMS or Whatsapp:</p>\n<p>&nbsp;<img src=\"image/admin/faq53883a407c2289t04592606.png\" alt=\"\" width=\"341\" height=\"207\" />&nbsp; &nbsp; &nbsp;&nbsp;<img src=\"image/admin/faq53883fbb34f448t41024576.png\" alt=\"\" width=\"341\" height=\"207\" /></p>\n<p>2)&nbsp;<strong>Selling Interest (Minimum Requirement)</strong></p>\n<p>&lt;<strong>Sell</strong>&gt; (Verb) +&nbsp;&lt;<strong>Property type</strong>&gt; (Bungalow, semi-d etc.) + &lt;<strong>Area</strong>&gt; (Jalan Anggerik, Taman Johor Jaya) + &lt;<strong>Budget</strong>&gt;<strong>&nbsp;</strong>(RM)&nbsp;+ &lt;<strong>Size</strong>&gt; (Sqft)&nbsp; <br />to&nbsp;<strong>+60178761590</strong></p>\n<p>Example:</p>\n<p>&nbsp;<img src=\"image/admin/faq538c0f57f162a3t56862043.png\" alt=\"\" width=\"342\" height=\"207\" />&nbsp; &nbsp; &nbsp;&nbsp;<img src=\"image/admin/faq53884d4acb0d95t81534099.png\" alt=\"\" width=\"341\" height=\"207\" /></p>\n<p>Ah Gong will process the data and reply to you <strong>within 1 minute</strong>. &nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;&nbsp;<img src=\"image/admin/faq539027c7e56df4t07775065.png\" alt=\"\" width=\"340\" height=\"232\" />&nbsp; &nbsp; &nbsp;&nbsp;<img src=\"image/admin/faq538c0de0e256b8t67039874.png\" alt=\"\" width=\"340\" height=\"232\" /></p>\n<p>You may <strong>post</strong> this property request by replying <strong>\"1\"</strong> to Ah Gong.</p>\n<p>&nbsp;</p>\n<p>&nbsp;&nbsp;<img src=\"image/admin/faq53902377ef48c1t68277038.png\" alt=\"\" width=\"337\" height=\"267\" />&nbsp; &nbsp; &nbsp;&nbsp;<img src=\"image/admin/faq5390254bcefc67t35656146.png\" alt=\"\" width=\"340\" height=\"269\" /></p>\n<p>You can also upload your <strong>property photos</strong> by posting via <strong>Whatsapp</strong>.</p>\n<p>&nbsp;</p>\n<p>&nbsp;<img  left;\" src=\"image/admin/faq539026050c1200t48843860.png\" alt=\"\" width=\"643\" height=\"264\" /></p>\n<p>Your posting has been posted on our website, <a href=\"http://www.askahgong.com\">www.askahgong.com</a>, allowing everyone to view and contact you as soon as possible.</p>\n<h4 class=\"faq-title\">Q: Can I add in more details about my property, such as facility and other description?</h4>\n<p>A: It is recommended for listing to contain as many criteria as possible. You can include the following into your SMS,&nbsp;</p>\n<p>Optional Criteria:</p>\n<ol>\n<li><strong>Tenure</strong>: Leasehold/freehold, etc.</li>\n<li><strong>Facility &amp; Amenities</strong>: Swimming pool/security/renovated, etc.</li>\n<li><strong>Price per square feet</strong>&nbsp;: RMXXXpsf</li>\n<li><strong>Price range</strong>&nbsp;(Instead of price) : Min RMXXX Max RMXXX</li>\n<li><strong>Description</strong>: Eg. \"This is a property that has a lot of investment value, with its proximity to new university.\"</li>\n</ol>\n<p>&nbsp;<strong>Remarks:&nbsp;</strong></p>\n<ol>\n<li>Each&nbsp;<strong>figure</strong>&nbsp;must be accompanied by&nbsp;<strong>a</strong>&nbsp;<strong>unit</strong>. E.g.: price (<strong>RM 2000</strong>), size (200<strong>&nbsp;sqf</strong>) and price per size (<strong>RM200 psf</strong>).</li>\n<li><strong>\"K\"&nbsp;</strong>represents&nbsp;<strong>thousand</strong>&nbsp;whereby \"<strong>M\"</strong>&nbsp;represents&nbsp;<strong>million.</strong>&nbsp;</li>\n</ol>\n<h4 class=\"faq-title\">Q: Why can\'t I find Ah Gong inside my Whatsapp\'s contact list?</h4>\n<div>A: Before sending message to Ah Gong via Whatsapp, you have to add Ah Gong\'s contact number, <strong>+6017-8761590</strong> into your <strong>phonebook</strong>. After that you will find Ah Gong inside your Whatsapp\'s contact list and be ready to post your property request.</div>\n<h4 class=\"faq-title\">Q: What happens when there are unrecognized words by Ah Gong?&nbsp;</h4>\n<p>A:<strong>&nbsp;</strong>If <strong>unrecognized area</strong> is detected, we will check its <strong>validity</strong> and reply user within <strong>24 hours</strong>.</p>\n<p><strong>The following condition will be replied with an auto message from the system:</strong></p>\n<ol>\n<li><strong><strong>ERROR_101_Two_Units_One_Num</strong>&nbsp;: </strong>One number accompanied by two units (\"RM200sqf\")</li>\n<li><strong>ERROR_102_Multiple_Actions</strong>&nbsp;: Trying to buy and sell at the same request. (\"buy and sell a house\")</li>\n<li><strong>ERROR_103_Null_Request</strong>&nbsp;: Meaningless sms request, may considered as spam.</li>\n<li><strong>ERROR_104_Not_Yet_Supported</strong>&nbsp;: Service or area that not yet supported found. Now only Johor Bahru and housing property is supported. (\"buy a house at Melaka\")&nbsp;</li>\n<li><strong>ERROR_105_Invalid_Valu</strong>e : Zero or negative value found. (\"buy a house with RM-200/buy a house with RM0\")</li>\n<li><strong>ERROR_106_No_Unit_Type</strong>&nbsp;: No unit found for the figures. (\"buy a house with 20000\")</li>\n<li><strong>ERROR_108_Ambiguous_Area</strong>&nbsp;: Jalan or Taman has multiple existence. (\"sell a condo in Jalan Teratai\" p/s: There are two Jalan Teratai in Johor Bahru) Inserting both taman and jalan is required.</li>\n<li><strong>ERROR_109_Swear_Word&nbsp;</strong>: Entry contains prohibited or rude word.&nbsp;</li>\n</ol>\n<p><strong>**Kindly follow the template to prevent keyword&rsquo;s conflict**</strong><strong>&nbsp;</strong></p>\n<h4 class=\"faq-title\">Q: Do I have to follow the sequence of the criteria as mentioned above?</h4>\n<p>A: No. You are not compulsory to follow the sequence exactly. Eg. buy Taman Mount Austin RM100000 bungalow.&nbsp;</p>\n<h4 class=\"faq-title\">Q: How do people see my post? How do they contact me?</h4>\n<p>A: Your post will be published on our&nbsp;<strong>website</strong>&nbsp;as SMS input. We display your&nbsp;<strong>contact number</strong>&nbsp;as well to enable interested users to contact you right away.&nbsp;</p>\n<h4 class=\"faq-title\">Q: Can I edit my own post?&nbsp;</h4>\n<p>A: Please <a href=\"http://askahgong.com/property/user/login\" target=\"_blank\">register</a> at our website to enjoy more functionalities. You can also <strong>post pictures</strong> on our website. &nbsp;</p>\n<h4 class=\"faq-title\">Q: What are the operation hours of Ah Gong\'s SMS/Whatsapp service?</h4>\n<div>A: Ah Gong\'s SMS/Whatsapp service is <strong>open 24 hours everyday</strong> as you can send your property request at any time you want to.</div>\n<h4 class=\"faq-title\">Q: How much does every SMS charge?</h4>\n<p>A: Our SMS is currently <strong>free of charge</strong>. Use Ask Ah Gong to spread your property interest!&nbsp;&nbsp;</p>'),(3,3,'<h4 class=\"faq-title\">Q: What is the recommended browser for Askahgong.com?&nbsp;</h4>\n<p>A:&nbsp;You are recommended to use <strong>Google Chrome</strong> to ensure <strong>greatest navigating experience</strong>. Alternatively, you can use other browsers such as Firefox, Opera, Internet Explorer 10 or above, etc.</p>\n<h4 class=\"faq-title faq-acc_lost\">Q: What can I do if my account is lost or hacked by others? Can I get back my account?&nbsp;</h4>\n<p>A:&nbsp;You can contact our admins right away by calling <strong>011-16181899</strong> or <strong>07-3588373</strong>. We will go through brief <strong>identity verification</strong> with you and help you to retrieve your account as soon as possible. To prevent account loss, we kindly advise you to <strong>log out</strong> every time if you are not using your own device. For the case of phone loss, you may report to your mobile service provider to retrieve your lost phone number and you can easily get back your account by <strong>resetting previous password</strong>.</p>\n<h4 class=\"faq-title\">Q: How can I retrieve my lost password?&nbsp;</h4>\n<p>A:&nbsp;There are two ways you can <strong>reset</strong> your password:</p>\n<ul  disc;\">\n<li><strong>SMS reset</strong>: Send \"<strong>resetpw</strong>\" to <strong>011-16181899</strong> and you will be replied on the new password</li>\n<li><strong>Email reset</strong>: Enter your&nbsp;<strong>Email</strong> and a new password will be sent to your Email</li>\n</ul>\n<p>Click <a href=\"user/login#resetpassword\" target=\"_blank\"><strong>here</strong></a> to reset your password.</p>\n<h4 class=\"faq-title\">Q: Is it possible to change my account&rsquo;s phone number? What should I do?&nbsp;</h4>\n<p>A:&nbsp;You may send an <a href=\"message/index/25\" target=\"_blank\"><strong>instant message</strong></a> to our admins and you will be able to change a new account&rsquo;s phone number after <strong>identity verification</strong>.</p>\n<h4 class=\"faq-title\">Q:&nbsp;How do I post my property interest?</h4>\n<p>A:&nbsp;Askahgong.com allows you to <strong>buy and sell</strong> any property. You can do it via</p>\n<p><strong>SMS</strong></p>\n<p>You can <strong>sms</strong> to <strong>011-16181899</strong>, stating whether you will like to buy or sell. For more information on the format, please click <a href=\"about/title/sms\" target=\"_blank\"><strong>here</strong></a>.</p>\n<p><strong>Website</strong></p>\n<p>By simply clicking on the <strong>Post Now button</strong> as shown below on the <a href=\"search/item\" target=\"_blank\"><strong>Search Page</strong></a>, it will lead you to the <strong><a href=\"posting/newpost\" target=\"_blank\">Posting Page</a></strong>, and you can do the rest. Please note that you need to <a href=\"user/login\" target=\"_blank\"><strong>register</strong></a> first before you can post via website.</p>\n<h4 class=\"faq-title\">Q: Can I suggest an area that is not recognized by Ah Gong? Similarly, can I add in some other facilities that are not inside the facility list?&nbsp;</h4>\n<p>A:&nbsp;You may suggest any new location to us through <a href=\"search/item\" target=\"_blank\"><strong>Search Page</strong></a>, <a href=\"posting/newpost\" target=\"_blank\"><strong>Posting Page</strong></a> or <a href=\"discussion/listing/1\" target=\"_blank\"><strong>Discussion&rsquo;s Feedback</strong></a> session. We will look into the suggestion and reply to you right after <strong>authentication</strong>. At the same time, you can also suggest other facilities through <strong><a href=\"posting/newpost\" target=\"_blank\">Posting Page</a></strong> and we will add the suggested facility into the list after validation.</p>\n<h4 class=\"faq-title\">Q: Why should I move the location marker on the map after I inserted the area in posting page?&nbsp;</h4>\n<p>A:&nbsp;You are recommended to move the marker to the <strong>exact location</strong> of your property to provide buyers with more <strong>accurate information</strong>. As we have default location marker on every road or &ldquo;Taman&rdquo;, moving your selling location will ensure that your selling marker <strong>does not overlap with the default marker</strong> when potential buyers are looking for properties at the same area.</p>\n<h4 class=\"faq-title faq-tenure\">Q: What is tenure about?&nbsp;</h4>\n<p>A:&nbsp;Tenure of properties includes three of the followings:</p>\n<ul>\n<li><strong>Freehold</strong>: Ownership tenure is for <strong>life</strong></li>\n<li><strong>Leasehold</strong>: Ownership tenure usually spans around <strong>30, 60, and 99 years,&nbsp;</strong>depending on the government<strong>&nbsp;</strong>regulation</li>\n<li><strong>Malay Reserved Land</strong>: Land cannot be sold to other races, even foreigners, other than <strong>Malays or Bumiputeras</strong></li>\n</ul>\n<h4 class=\"faq-title faq-builtup\">Q: What is built-up about?&nbsp;</h4>\n<p>A:&nbsp;In a nutshell, built-up area includes all the <strong>roofed area</strong> which includes <strong>covered porch</strong> and <strong>balcony</strong>. However, built-up area is different with <strong>land area</strong>. For landed property, built-up area does not include land which is not covered but land area does. For double-storey property, built-up area might be <strong>doubled up</strong> as it counts the second storey area as well whereby land area is just being measured by the total size of the <strong>construction land</strong>.</p>\n<p>We normally use &ldquo;<strong>square-feet</strong>&rdquo; as unit for build-up area as it is an imperial unit and U.S. customary unit which is commonly used worldwide. It is defined as the area of a square with sides of 1 foot. Symbol of &ldquo;square feet&rdquo; is &ldquo;<strong>sqft.</strong>&rdquo;.</p>\n<h4 class=\"faq-title\">Q: What should I do if my posting needs special handling?&nbsp;</h4>\n<p>A:&nbsp;You are advised to wait for our reply or directly feedback to us via <a href=\"message/index/25\" target=\"_blank\"><strong>instant&nbsp;messaging</strong></a>. Handling should not take more than&nbsp;<strong>10 minutes</strong>&nbsp;during working hours (9 a.m. to 6 p.m.).</p>\n<h4 class=\"faq-title\">Q: Can I post my buying request? Is it the same with posting property to sell?&nbsp;</h4>\n<p>A:&nbsp;Definitely. Via the <a href=\"posting/newpost\" target=\"_blank\"><strong>Posting Page</strong></a>, you can post either buying or selling request. Users will then see your posting after searching at the <a href=\"search/item\" target=\"_blank\"><strong>Search Page</strong></a> and interested seller will approach you right away via <a href=\"contact/messaging\" target=\"_blank\"><strong>Instant Messaging</strong></a>. Furthermore, posted property&rsquo;s owners with matched criteria will be <strong>instantly notified</strong> after you posted your buying request. Vice versa, you will get notified if there is any new <strong>matched</strong> property posted.</p>\n<h4 class=\"faq-title\">Q:&nbsp;Is my posting instant?</h4>\n<p>A:&nbsp;To&nbsp;<strong>prevent spams</strong>, all posting will be&nbsp;<strong>routed</strong>&nbsp;for permission before being published on the website. However, it will not take more than 1 minute.</p>\n<h4 class=\"faq-title\">Q: Can I edit my posting? Will others be notified for the changes of my posting?&nbsp;</h4>\n<p>A:&nbsp;You can navigate to <strong>Dashboard</strong>&gt;<a href=\"posting/view\" target=\"_blank\"><strong>My Posting</strong></a> to manage all your postings and <strong>edit</strong> your posting anytime you want. User who <strong>shortlisted</strong> your posting will be notified instantly once you made any changes on it.</p>\n<h4 class=\"faq-title\">Q: Do I need to delete my posting if the transaction has been dealt?</h4>\n<p>A:&nbsp;Yes, of course. You have to delete your <strong>dealt posting</strong> to ensure that all the postings at the site are <strong>active</strong> postings. (You may get <strong>reported</strong> if other users find that your posting has actually expired)</p>\n<h4 class=\"faq-title\">Q: Will my posting expire?</h4>\n<p>A:&nbsp;Every posting has a life of <strong>3 months</strong> after being posted. You will be <strong>notified</strong> when your posting is about to expire and you will be able to <strong>extend</strong> your posting&rsquo;s life.</p>\n<h4 class=\"faq-title\">Q: Can I post my property on sale even if I am not a property agent?</h4>\n<p>A:&nbsp;Yes, you can. Nevertheless, it is advisable for you to approach an agent to carry out all the<strong> transaction process</strong>.</p>\n<h4 class=\"faq-title\">Q:&nbsp;How can I find a trustworthy agent to be my representative?</h4>\n<p>A:&nbsp;There is a page (<strong>Contact &gt;&nbsp;<a href=\"contact/agents\" target=\"_blank\">Find an Agent</a></strong>) for you to choose an agent based on their&nbsp;<strong>reputation levels</strong>.</p>\n<h4 class=\"faq-title\">Q: Do I need to accept contact request in order to permit others to contact me?</h4>\n<p>A:&nbsp;No, contact will be instantly added&nbsp;<strong>without verification</strong>. Meanwhile, this event will be recorded under your&nbsp;<a href=\"activity\" target=\"_blank\"><strong>activity log</strong></a>.&nbsp;<strong>Non-contacts</strong>&nbsp;are also&nbsp;<strong>allowed to contact</strong>&nbsp;you if they are interested in your post.</p>\n<h4 class=\"faq-title faq-contact_method\">Q: Can I hide my phone number?</h4>\n<p>A:&nbsp;Yes, you can hide your phone number under Dashboard &gt; <a href=\"profile#contact_method\" target=\"_blank\"><strong>Profile</strong></a>. There is also an option for you to <strong>reveal your phone number to your contact only</strong>.</p>\n<h4 class=\"faq-title faq-contact_method\">Q: Is my contact number still revealed to others during my non-working hour?</h4>\n<p>A:&nbsp;Yes, It will still be revealed. However, other user will be able to know your <a href=\"profile#contact_method\"><strong>operating hours</strong></a> and not to contact you during your non-working hours. You can simply lodge a <strong>report</strong> to our admins if you receive any harassment.</p>\n<h4 class=\"faq-title\">Q: Will all my activities be recorded?</h4>\n<p>A:&nbsp;Yes, all your recent activities are recorded under Dashboard &gt; <a href=\"activity\" target=\"_blank\"><strong>Activity</strong></a>. You can also view other user&rsquo;s dashboard to get <strong>updated information</strong> about others.</p>\n<h4 class=\"faq-title faq-reputation\">Q: How does the user ranking mechanism work? What benefit will user get from it?</h4>\n<p>A:&nbsp;User ranking reflects <strong>reputation</strong> of user. Reputation points can be earned through:</p>\n<p><strong>1. Daily login </strong></p>\n<ul>\n<li><strong>First time login</strong>: <strong>4</strong> pts</li>\n<li><strong>2</strong> days consecutive login: <strong>4</strong> pts</li>\n<li><strong>3</strong> days consecutive login: <strong>6</strong> pts</li>\n<li>4 days consecutive login: <strong>8</strong> pts</li>\n<li><strong>5</strong> days consecutive login: <strong>10</strong> pts</li>\n<li><strong>6</strong> days consecutive login: <strong>12</strong> pts</li>\n<li><strong>7</strong> days consecutive login: <strong>14</strong> pts</li>\n</ul>\n<p>After seven days of consecutive login, it will be reset.</p>\n<p><strong>2. Discussion involvement </strong></p>\n<ul>\n<li><strong>Reply</strong> on any topic: <strong>1</strong> pt</li>\n<li>Valuable <strong>comment</strong> on any topic: <strong>5</strong> pts</li>\n<li>Valuable <strong>feedback</strong>: <strong>5</strong> pts</li>\n<li>Valuable comment with <strong>detailed explanation/suggestion</strong>: <strong>10</strong> pts</li>\n</ul>\n<p>Our discussion administrator will go through all the comments and give credits to those valuable comments.</p>\n<p><strong>3. Rating given by other users through transaction </strong></p>\n<p><strong>4. Full completed user profile: 5 pts </strong></p>\n<p><strong>5. Suggestion of new area/facility: 5 pts </strong></p>\n<p><strong>6. Item posting with full details and pictures: 3 pts</strong></p>\n<p>Meanwhile, user will get <strong>discount</strong> for any <strong>membership purchase</strong> based on reputation level. For example, Mr. Lee can get 10% discount on premium membership purchase when his reputation level is 10.</p>\n<h4 class=\"faq-title faq-notification\">Q: What kind of notification I will receive? Can I change the way of being notified?</h4>\n<p>A:&nbsp;There are three kinds of notifications you will receive:</p>\n<ul>\n<li><strong>Shortlisted Item Modification</strong>: If any of your shortlisted items has been <strong>deleted </strong>or<strong> edited</strong>, you will receive an instant notification at the <strong>shortlist box</strong> on the top main menu</li>\n<li><strong>Discussion Reply</strong>: If there is any <strong>reply </strong>of your<strong> discussion topic </strong>or<strong> comment</strong>, you will receive an instant notification at the top right corner</li>\n<li><strong>New Items Notification</strong>: There is a default notification setting that if there is any new item that matching your <strong>posting&rsquo;s criteria</strong>, you will be notified instantly at the top right corner</li>\n</ul>\n<p>In spite of this, you can also manually set up <strong>new notification</strong> under <strong>Dashboard &gt; <a href=\"settings\" target=\"_blank\">Settings</a></strong>. Alternatively, you can also sign up our <strong>premium membership</strong> to get notified through <strong>SMS</strong>.</p>\n<h4 class=\"faq-title\">Q:&nbsp;What should I do if I do not get any matched result?</h4>\n<p>A: If there is no matched result for your search, you are recommended to:</p>\n<ul>\n<li><strong>Adjust Search Criteria</strong> - Lower down your selling max. price or increase your buying budget</li>\n<li><strong>Post Your Interest</strong>&nbsp;- Let others know your interest and approach you</li>\n</ul>\n<h4 class=\"faq-title\">Q:&nbsp;Why am I recommended to post my interest online?</h4>\n<p>A:&nbsp;You are <strong>recommended to post</strong>&nbsp;whether you get any matched result or not. It is because:</p>\n<ul>\n<li><strong>(No result)</strong> - Users can contact you if they have some interests that they have not made available public</li>\n<li><strong>(Result available)</strong> - You can still post your interest to increase your opportunities.</li>\n</ul>\n<p>In addition, posting allows you to know <strong>new matched item</strong>. Click <a href=\"about/title/features#new-matched-item\"><strong>here</strong></a> for more information.</p>\n<h4 class=\"faq-title faq-exact_match\">Q:&nbsp;What is the meaning of \"Exact Match\" search mode?</h4>\n<p>A:&nbsp;It means that your searched results must be <strong>exactly matched</strong> with the <strong>search criteria</strong>. <br />Take for an example, your search criteria is buy condo + freehold. As a result, you will only get results \"sell condo + freehold + etc.\" and ignore other results with \"unknown tenure\" (usually SMS post).</p>\n<h4 class=\"faq-title faq-exact_match\">Q:&nbsp;What if I cannot get any result by turning on \"Exact Match\"?</h4>\n<p>A:&nbsp;You may turn it off in order to get more result with <strong>\"unknown category\" (e.g. tenure/facility)</strong>.</p>\n<h4 class=\"faq-title\">Q:&nbsp;If I put RM1,000,000 as min. price of my property, will I get result of buying interest with budget of RM990,000?</h4>\n<p>A:&nbsp; No. As stated, any result with budget that is&nbsp;<strong>lower</strong> than your <strong>minimum price</strong> will be <strong>eliminated</strong>.</p>\n<p>In order to get more results, you should just set maximum price unless minimum price can help to eliminate some of the irrelevant choices that are too good to be true.&nbsp;&nbsp;</p>\n<h4 class=\"faq-title\">Q:&nbsp;Will I get any result of property that is located near my inserted area?</h4>\n<p>A:&nbsp; To ensure accuracy of the item-matching algorithm, you will only get result of property that is located exactly at the area that you have inserted.</p>\n<h4 class=\"faq-title\">Q:&nbsp;Why can\'t I insert Melaka into \"Area\" textbox?</h4>\n<p>A:&nbsp;Unfortunately, currently we only provide service in <strong>Johor Bahru</strong>. You will be informed once we expand our service to another district.</p>\n<h4 class=\"faq-title\">Q:&nbsp;What is the fastest to contact the post owner once I view the result item after searched?</h4>\n<p>A:&nbsp;You can mouse-over on the<strong> username</strong> and you will see a <strong>pop-out</strong>. Click the <strong>&ldquo;Message User&rdquo;</strong> icon which is located at top right corner and you can begin the <strong>conversation</strong> with the post owner.</p>\n<h4 class=\"faq-title\">Q:&nbsp;What can I do if the user has not replied to me for quite a long time?</h4>\n<p>A:&nbsp;You can send the instant message to the recipient by <strong>SMS</strong>. However, there is <strong>restriction</strong> for each user to use the SMS function:</p>\n<ul>\n<li>Each user only can send a total <strong>3 SMS per day</strong></li>\n<li>Each user only can send <strong>1 SMS to the same recipient per hour</strong></li>\n<li>You cannot send SMS to the recipient during his/her <strong>non-working hour</strong></li>\n<li>You cannot send <strong>picture</strong> through SMS</li>\n</ul>\n<h4 class=\"faq-title\">Q:&nbsp;Is this web messaging instant?</h4>\n<p>A:&nbsp;Absolutely. Message is <strong>instantly sent</strong> and the recipient will receive the message within <strong>0.5 seconds delay</strong>.</p>\n<h4 class=\"faq-title\">Q:&nbsp;Will post owners be notified if I shortlist their post?</h4>\n<p>A:&nbsp;No, no one can view your shortlist other than yourself.&nbsp;</p>\n<h4 class=\"faq-title\">Q:&nbsp;How does discussion work?</h4>\n<p>A:&nbsp;Discussion allows users of Ask Ah Gong to <strong>post topics and comments</strong> related to properties. Please note that Ask Ah Gong editor retains the right to remove any post deemed inappropriate and to combine repeated posting. Topics are ranked based on their <strong>popularity </strong>and<strong> relevance</strong>. Click <a href=\"discussion/listing\" target=\"_blank\"><strong>here</strong></a> to access discussion.</p>\n<h4 class=\"faq-title\">Q:&nbsp;Why is my discussion topic or comment deleted?</h4>\n<p>A:&nbsp;There are few possibilities causing your discussion topic/comment to be deleted:</p>\n<ul>\n<li><strong>Vulgarity</strong> is detected</li>\n<li>Excessive <strong>spamming </strong></li>\n<li><strong>Personal attack</strong>&nbsp;and other sensitive issues such as <strong>religion</strong>, <strong>culture</strong>, <strong>discrimination</strong>, etc</li>\n</ul>\n<h4 class=\"faq-title\">Q:&nbsp;Do I have to pay to use AskAhgong.com?</h4>\n<p>A:&nbsp;Currently, we are having <strong>beta-phase</strong> which provides all the service for <strong>free</strong>. We will launch the membership plan when the beta-phase has ended.</p>'),(4,1,'<div class=\"white-gradient-box\">\n<div class=\"text-container\">\n<h5>Who is Ah Gong?</h5>\n<p>On <strong>13rd June 2013</strong>, Ah Gong was born in <strong>Johor Bahru</strong>.</p>\n<p>Ah Gong means \"<strong>Grandpa</strong>\" in Chinese, Ah Gong is:</p>\n<ul>\n<li class=\"no-effect-parent\"><span>Someone&nbsp;who has many <strong>experiences</strong> in life</span></li>\n<li><span>Someone who has few simple <strong>principles</strong> ingrained in him</span></li>\n<li><span>Someone who transforms the <strong>complicated into simple</strong>, forming conclusions based on his principles</span></li>\n<li><span>Someone who sees&nbsp;only the necessary stuff, and ignores everything else that is negligible</span></li>\n<li><span>Someone who teaches and guides younger generations with all the <strong>knowledge</strong> he possessed</span></li>\n</ul>\n</div>\n<div class=\"image-container\"><img src=\"image/admin/faq53916196b181d2t29481811.jpeg\" alt=\"\" width=\"526\" height=\"250\" /></div>\n<img class=\"image-shadow\" src=\"image/right_shadow.png\" alt=\"\" /></div>\n<div class=\"white-gradient-box\">\n<div class=\"text-container\">\n<h5>Why do we ask Ah Gong?</h5>\n<p>Others present data. We present&nbsp;<strong>data easy</strong></p>\n<ul>\n<li><span>Ask Ah Gong is the first Southeast Asia&nbsp;data easy&nbsp;company.&nbsp;Data easy&nbsp;is about collecting data via the most convenient channel to the users and presenting them in an enriched, easy to under manner. <br /><br /><strong>I.e.</strong> We make your data really work for you.&nbsp;</span></li>\n</ul>\n</div>\n<div class=\"image-container\"><img src=\"image/admin/faq53466c127443f1t15378327.png\" alt=\"\" width=\"192\" height=\"250\" /></div>\n</div>\n<div class=\"white-box\">\n<h5>What do we do?</h5>\n<p>We help to,&nbsp;</p>\n<ul>\n<li><span>Convert your <strong>SMS posting</strong> to Web messages to save time on posting</span></li>\n<li><span>Provide a clean <strong>dashboard</strong> for you to connect to your would-be buyer and seller</span></li>\n</ul>\n<div class=\"image-container\"><img src=\"image/admin/flow.png\" alt=\"\" /></div>\n</div>'),(5,2,'<div class=\"white-gradient-box\">\n<div class=\"text-container\">\n<h1><span class=\"faq-title\" data-mce-mark=\"1\">Fast &amp; Easy</span></h1>\n<h5>Why do we call it \"Fast &amp; Easy\"?</h5>\n<span data-mce-mark=\"1\"><br /></span>\n<ul>\n<li><span data-mce-mark=\"1\"><strong>Less cluttered,&nbsp;</strong><strong>more</strong>&nbsp;<strong>user-friendly<br /></strong></span></li>\n<li><span data-mce-mark=\"1\"><strong>Posting a property offer, with SMS/Whatsapp, under few minutes</strong></span></li>\n</ul>\n</div>\n<div class=\"image-container\"><img src=\"image/admin/fast.png\" alt=\"\" width=\"407\" height=\"449\" /></div>\n</div>\n<div class=\"orange-gradient-box left-side\">\n<div class=\"text-container\">\n<h1>Dashboard</h1>\n<h5>After login, you will be directed to the dashboard page, which allows you to:</h5>\n<ul>\n<li>See&nbsp;<strong>recent activities</strong></li>\n<li>View <strong>previous postings and shortlisted items</strong></li>\n<li>View <strong>posts by your contacts</strong>&nbsp;<strong><br /></strong></li>\n<li><strong>Link</strong> to various pages to make it easy for you to navigate &nbsp;</li>\n</ul>\n</div>\n<div class=\"image-container\">&nbsp;<img src=\"image/admin/faq53916c8bb47407t06106045.jpeg\" alt=\"\" width=\"317\" height=\"192\" /></div>\n</div>\n<div class=\"orange-gradient-box right-side\">\n<div class=\"text-container faq_messaging\">\n<h1>Instant Messaging</h1>\n<h5>You can initiate <strong>direct conversation</strong> with others with just a few simple clicks.&nbsp;With \"Instant Messaging\", you are able to:</h5>\n<ul>\n<li>Contact users&nbsp;<strong>right away</strong>, without using E-mail, SMS or direct call</li>\n<li>Know which user is online, by viewing the <strong>user\'s status</strong></li>\n<li>Get <strong>instant notification</strong> once you get any reply&nbsp;&nbsp;</li>\n</ul>\n</div>\n<div class=\"image-container\"><img src=\"image/admin/faq53916c6ede4b93t41532197.jpeg\" alt=\"\" width=\"327\" height=\"192\" /></div>\n</div>\n<div class=\"orange-gradient-box left-side\">\n<div class=\"text-container\">\n<h1>Discussion</h1>\n<h5>Any suggestion, recommendation or feedback? <br />Ah Gong\'s \"Discussion\" allows you to:</h5>\n<ul>\n<li><strong>Interact</strong> with other users and build your<strong> reputation&nbsp;</strong>within the community!</li>\n<li>Know the&nbsp;<strong>latest industry news</strong> and <strong>gossips</strong></li>\n<li>Share your <strong>feedback</strong> and <strong>suggestion</strong> to&nbsp;us<br /><br /></li>\n</ul>\n</div>\n<div class=\"image-container\"><img src=\"image/admin/faq539169097984d1t93492575.jpeg\" alt=\"\" width=\"372\" height=\"192\" /></div>\n</div>\n<div class=\"orange-gradient-box right-side\">\n<div class=\"text-container faq_shortlist\">\n<h1><span class=\"faq-title\" data-mce-mark=\"1\">Shortlist</span></h1>\n<h5>Found your desired property? Ask Ah Gong\'s Shortlist function allows you to:</h5>\n<ul>\n<li>Shortlist a <strong>desired item</strong></li>\n<li>Retain your shortlisted item for <strong>further interest and comparison</strong></li>\n<li>Get <strong>instant notification</strong> when your shortlisted item is edited or deleted&nbsp;&nbsp;</li>\n</ul>\n</div>\n<div class=\"image-container\"><img src=\"image/admin/faq53916cc47e0082t29181031.jpeg\" alt=\"\" width=\"372\" height=\"192\" /></div>\n</div>\n<div class=\"orange-gradient-box left-side\">\n<div class=\"text-container faq_buysell\">\n<h1><span class=\"faq-title\" data-mce-mark=\"1\">Buy &amp; Sell</span></h1>\n<h5>Unlike common property website that only caters to selling agents, our customers are,&nbsp;</h5>\n<ul>\n<li><strong>Typical property agents</strong> who will like to buy and sell properties</li>\n<li>Potential <strong>property owners</strong> who intend to sell their properties but do not have an agent representative</li>\n<li>Potential <strong>property buyers</strong> who intend to purchase or invest on properties but do not have an agent representative</li>\n</ul>\n</div>\n<div class=\"image-container\">&nbsp;<img src=\"image/admin/faq53916cdcdcb699t03677697.jpeg\" alt=\"\" width=\"372\" height=\"192\" /></div>\n</div>\n<div class=\"orange-gradient-box right-side\">\n<div class=\"text-container\">\n<h1><span class=\"faq-title\" data-mce-mark=\"1\">Google Map</span></h1>\n<h5>How might Ah Gong\'s featured Google Map help you?</h5>\n<ul>\n<li>With our own <strong>Ah Gong\'s taggings</strong>, you will know of all the <strong>landmarks</strong>&nbsp;near your desired property not even found on normal Google map</li>\n<li>You can indicate the <strong>exact location</strong> of the selected property</li>\n<li><strong>Easy guide</strong> to go to the location you want to from your desired property</li>\n</ul>\n</div>\n<div class=\"image-container\"><img src=\"image/admin/faq53916d2d522d23t47388477.jpeg\" alt=\"\" width=\"309\" height=\"190\" /></div>\n</div>\n<div class=\"orange-gradient-box left-side\">\n<div class=\"text-container new-matched-item\">\n<h1>New Matched Item Discovery</h1>\n<h5>New matched item can be found at the&nbsp;<strong>Item Page</strong> of your post. With this feature, you can:</h5>\n<ul>\n<li>View <strong>new</strong> and <strong>previously matched items</strong> at a glance</li>\n<li><strong>C</strong><strong>ontact </strong>owners of&nbsp;new matched post instead of waiting for him to approach you</li>\n<li><strong>Save on</strong>&nbsp;<strong>time </strong>on search by being&nbsp;updated on the new matched results</li>\n</ul>\n</div>\n<div class=\"image-container\"><img src=\"image/admin/faq53916d5a07b2c7t45687813.jpeg\" alt=\"\" width=\"372\" height=\"192\" /></div>\n</div>\n<div class=\"orange-gradient-box right-side\">\n<div class=\"text-container faq_sw\">\n<h1>SMS/Whatsapp</h1>\n<h5>With SMS/Whatsapp feature, you can:&nbsp;</h5>\n<ul>\n<li>Register your interest within a few minutes, <strong>without</strong> even <strong>booting up your computer</strong></li>\n<li>Complete your posting <strong>without internet access</strong>&nbsp;</li>\n<li>Search and post your interest instantly, when you are on the go!</li>\n<li>Post pictures directly from your phone (only available on Whatsapp)</li>\n</ul>\n</div>\n<div class=\"image-container\"><img src=\"image/admin/faq53916d6f5ef3c2t36048710.jpeg\" alt=\"\" width=\"372\" height=\"192\" /></div>\n<div class=\"image-container\">&nbsp;</div>\n<div class=\"image-container\">&nbsp;</div>\n</div>\n<div class=\"orange-gradient-box left-side\">\n<div class=\"text-container item-notification\">\n<h1>Instant Item Notification</h1>\n<h5>Always on the move? We make sure you never miss any property lead again. Via SMS/Web Notification,&nbsp;</h5>\n<ul>\n<li><span data-mce-mark=\"1\">You will be notified instantly on any new opportunity and save on your time on searching</span><strong>&nbsp;</strong></li>\n<li><span data-mce-mark=\"1\">You can go anywhere with your phone without any worries, as we will keep you updated always</span></li>\n<li><span data-mce-mark=\"1\">We alert potential buyers about your posted properties, making it more targeted, and better than classified</span>&nbsp;</li>\n</ul>\n</div>\n<div class=\"image-container\"><img src=\"image/admin/faq53916d7bd22b61t97627897.jpeg\" alt=\"\" width=\"439\" height=\"250\" /></div>\n<div class=\"image-container\">&nbsp;</div>\n</div>\n<div class=\"white-gradient-box\">\n<div class=\"text-container no-indicator\">\n<h2><span class=\"faq-title\" data-mce-mark=\"1\">REGISTER NOW</span></h2>\n<div>\n<h2><span class=\"faq-title\" data-mce-mark=\"1\">TO GET</span></h2>\n</div>\n<div>&nbsp;</div>\n<ul>\n<li><strong>Social networking features</strong></li>\n<li><strong>Instant Posting</strong></li>\n<li><span data-mce-mark=\"1\"><strong>Shortlist and notification features</strong><br /></span></li>\n</ul>\n<h3>To be 1 step ahead of others</h3>\n</div>\n<div class=\"image-container\"><img src=\"image/admin/registernow.png\" alt=\"\" width=\"396\" height=\"419\" /></div>\n</div>');
